
-- This gets questions and answers with their parent questions
SELECT parent_posts.id, child_posts.id, parent_posts.title
FROM public.posts AS child_posts
LEFT JOIN public.posts AS parent_posts
ON child_posts.parentid = parent_posts.id
WHERE child_posts.parentid IS NOT NULL
ORDER BY parent_posts.id DESC
OFFSET 15
LIMIT 50;


-- This gets all question IDs that have at least one answer
SELECT parent_posts.id, COUNT(child_posts.id) AS num_answers, parent_posts.title
FROM public.posts AS parent_posts
INNER JOIN public.posts AS child_posts
ON child_posts.parentid = parent_posts.id
GROUP BY parent_posts.id, parent_posts.title
ORDER BY parent_posts.id DESC
OFFSET 15
LIMIT 50;


-- This gets questions along with all their answers concatenated into a single field
SELECT 
    parent_posts.id,
    parent_posts.title,
    COUNT(child_posts.id) AS num_answers,
    parent_posts.body AS parent_body,
    STRING_AGG(child_posts.body, '------- \n\n -------' ORDER BY child_posts.id) AS all_answers
FROM public.posts AS parent_posts
INNER JOIN public.posts AS child_posts
    ON child_posts.parentid = parent_posts.id
GROUP BY parent_posts.id, parent_posts.title, parent_posts.body
ORDER BY parent_posts.id DESC
LIMIT 50;



